import React from "react";
import "../styles/bottombar.css";


function BottomBar() {
    return ( 
        <div className = "bottomBar">
            {array.map((arrayItem, token)=> { return (<p className="Names" key={token}>{arrayItem}</p>)})}
        </div>
    );
}

export default BottomBar;
